import { Component, OnInit } from '@angular/core';
import { Preferences } from '@capacitor/preferences';
import { RegionService } from '../service/region.service';
import { Region } from '../models/region.model';

@Component({
  selector: 'app-user-registration',
  templateUrl: './user-registration.page.html',
  styleUrls: ['./user-registration.page.scss'],
})

export class UserRegistrationPage implements OnInit {
  regiones: Region[] = [];
  regionSeleccionada: Region = { id: 0, nombre: '' };

  usuario: string = '';
  nombre: string = '';
  rut: string = '';
  correo: string = '';
  carrera: string = '';
  telefono: string = '';
  region: string = '';
  direccion: string = '';

  constructor(private regionService: RegionService) {}

  ngOnInit() {
    this.regionService.getRegiones().subscribe(response => {
      this.regiones = response.regiones;
      console.log(this.regiones);
    });
  }

  async guardarDatos() {
    // Puedes realizar acciones aquí, como guardar los datos uno por uno.
    // Por ejemplo, podrías almacenar cada campo en las Preferences de Capacitor.
    // Te recomendaría adaptar esta función según tus necesidades específicas.
  }
}
<ion-header [translucent]="true">
  <ion-toolbar>
    <ion-title>Registro de Usuario</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true" class="ion-padding">
  <ion-item>
    <ion-label>Usuario</ion-label>
    <ion-input type="text" [(ngModel)]="usuario"></ion-input>
  </ion-item>

  <ion-item>
    <ion-label>Nombre</ion-label>
    <ion-input type="text" [(ngModel)]="nombre"></ion-input>
  </ion-item>

  <ion-item>
    <ion-label>RUT</ion-label>
    <ion-input type="text" [(ngModel)]="rut"></ion-input>
  </ion-item>

  <ion-item>
    <ion-label>Correo</ion-label>
    <ion-input type="email" [(ngModel)]="correo"></ion-input>
  </ion-item>

  <ion-item>
    <ion-label>Carrera</ion-label>
    <ion-input type="text" [(ngModel)]="carrera"></ion-input>
  </ion-item>

  <ion-item>
    <ion-label>Teléfono</ion-label>
    <ion-input type="tel" [(ngModel)]="telefono"></ion-input>
  </ion-item>

  <ion-item>
    <ion-label>Región</ion-label>
    <ion-input type="text" [(ngModel)]="region"></ion-input>
  </ion-item>

  <ion-item>
    <ion-label>Dirección</ion-label>
    <ion-input type="text" [(ngModel)]="direccion"></ion-input>
  </ion-item>

  <!-- Botón para almacenar datos -->
  <ion-button (click)="guardarDatos()">Guardar Datos</ion-button>
</ion-content>
